import React from 'react';
import ReactDOM from 'react-dom';
import './index.css';
import MediaCard from './MediaCard';
import * as serviceWorker from './serviceWorker';
import logo from './logo.svg';
import MediaList from './MediaList';

ReactDOM.render(<MediaList 
  name="Alex Guerrero"
  date="Martes 7 de mayo del 2019"
  img= {logo}
  text='pene pene pene pene pene pene pene pene pene pene pene pene pene pene pene pene pene pene pene pene pene pene pene pene pene pene pene pene pene pene pene pene pene pene pene pene pene pene pene pene pene pene pene pene pene pene pene pene pene pene pene pene pene pene pene pene pene pene pene pene pene pene pene pene pene pene pene pene pene pene pene pene pene pene pene pene pene pene pene pene pene pene pene pene pene pene pene pene pene pene pene pene pene pene pene pene pene pene pene pene pene pene pene pene pene pene pene pene pene pene pene pene pene pene pene pene pene pene pene '
  likes= '37'  
  />, document.getElementById('root'));

// If you want your app to work offline and load faster, you can change
// unregister() to register() below. Note this comes with some pitfalls.
// Learn more about service workers: https://bit.ly/CRA-PWA
serviceWorker.unregister();
